description:
Bán nhà 3 tầng, mặt đường, thiết kế hiện đại, vị trí đẹp, Kiến An, Hải Phòng
Diện tích MB : 59m2; 
Diện tích SD: 150m2; 
Chiều rộng: 5.5m;
Hướng: Tây Nam; 
Giấy tờ: Sổ đỏ chính chủ, giấy phép xây dựng;
۩۩۩ Vị trí ngôi nhà: Nhà 3 tầng xây mới độc lập, thiết kế hiện đại, vị trí đẹp, phong thủy tốt, mặt đường rộng  ô tô tránh nhau, xung quanh nhiều tiện ích, địa điểm gần đường Nguyễn Lương Bằng, Ngã 5 Kiến An, trường học các cấp từ mầm non, Cấp 1, Cấp 2 Phan Đăng Lưu, Cấp 3 Kiến An, ĐH Hải Phòng, các trung tâm mua sắm (Vinmart, Thế giới di động, Điện máy xanh), Ngân Hàng (Agribank, Techcombank ...), chợ, UBND Phường, Bệnh viện, dân cư đông đúc, khu phố sầm uất, an ninh khu vực tốt, giao thông thuận tiện sinh hoạt. 
۩۩۩ Nhà được thiết kế 3 tầng xây độc lập 
Tầng 1: phòng khách, bếp, WC; 
Tầng 2: 2 phòng ngủ rộng rãi, WC;
Tầng 3: Phòng thờ, phòng ngủ, sân phơi, WC;
Tiện nghi: điện nước, truyền hình cáp, internet đầy đủ. 
$$$ Giá: 2 tỷ 850 triệu (thỏa thuận)
(Có hỗ trợ ngân hàng đến 75%, thủ tục nhanh chóng, giải ngân nhanh) 
Quý khách vui lòng liên hệ Mr Phát 0918.767.186 để biết thêm thông tin.
